import { Chart} from 'react-chartjs-2';

const BarChart = () => {
    return (
      <div>
        <Chart
            type='bar'
            datasetIdKey= 'barChart'
            data={{
                labels: [
                    'January',
                    'February',
                    'March',
                    'April',
                    'May',
                    'June'],
                datasets: [
                    {
                        label: 'My First dataset',
                        backgroundColor: 'rgb(255, 99, 132)',
                        borderColor: 'rgb(255, 99, 132)',
                        data: [2, 10, 5, 2, 20, 30, 45] 
                    }
                ]
            }} 
            height={200} 
            width={600}/>
      </div>
    );
}

export default BarChart;
